import json

from web3 import Web3
import os

w3 = Web3(Web3.HTTPProvider('http://127.0.0.1:8545'))

bytecode = ''
with open('contract_ABI.json', 'r') as abi_f:
    abi = json.load(abi_f)

Auther = w3.eth.contract(abi=abi, bytecode=bytecode)

if os.path.exists('pwd_admin.txt'):
    with open('pwd_admin.txt','r') as f:
        pwd = f.read().replace('\n', '').replace('\r', '')
        f.close()
else:
    pwd = input('please input the password of admin: ')

w3.geth.personal.unlock_account(w3.eth.accounts[0], pwd)
tx_hash = Auther.constructor().transact({'from': w3.eth.accounts[0]})

tx_receipt = w3.eth.wait_for_transaction_receipt(tx_hash)

with open('contract.txt', 'w') as f:
    pwd = f.write(tx_receipt.contractAddress)
    f.close()

print('contract has been deployed at ', tx_receipt.contractAddress)

